CREATE TABLE author(name VARCHAR(80) PRIMARY KEY, picture VARCHAR(2047), summary VARCHAR(2047));

CREATE TABLE book(product_id SERIAL PRIMARY KEY, name VARCHAR(255), description VARCHAR(2047), price NUMERIC(14, 2), publisher_price NUMERIC(8, 2), sold_count INT, isbn VARCHAR(10), series VARCHAR(255), format VARCHAR(255), pages INT);

CREATE TABLE coupon(coupon_code VARCHAR(80) PRIMARY KEY, is_percent BOOLEAN NOT NULL, savings NUMERIC(8, 2) NOT NULL, valid_from TIMESTAMP, valid_to TIMESTAMP);

CREATE TABLE product(product_id SERIAL PRIMARY KEY, name VARCHAR(255), description VARCHAR(2047), price NUMERIC(14, 2), publisher_price NUMERIC(8, 2), sold_count INT);

CREATE TABLE publisher(name VARCHAR(80) PRIMARY KEY, address VARCHAR(2047), email VARCHAR(255), phone BIGINT, institution_number SMALLINT, branch_number INT, account_number BIGINT);

CREATE TABLE warehouse(name VARCHAR(80) PRIMARY KEY, address VARCHAR(255) NOT NULL, phone BIGINT, area_sqft INT);

CREATE TABLE storeorder(order_number SERIAL UNIQUE, username VARCHAR(255) REFERENCES user, status VARCHAR(80) NOT NULL, billed_to VARCHAR(2047), shipped_to VARCHAR(2047), time_placed TIMESTAMP NOT NULL, delivery_fee NUMERIC(8, 2) NOT NULL, PRIMARY KEY(order_number, username));

CREATE TABLE cart(username VARCHAR(255) PRIMARY KEY REFERENCES user, last_edited TIMESTAMP);

CREATE TABLE book_genre(product_id INT NOT NULL REFERENCES book, genre VARCHAR(80) NOT NULL, PRIMARY KEY(product_id, genre));

CREATE TABLE product_image(product_id INT NOT NULL, image VARCHAR(2047) NOT NULL, PRIMARY KEY(product_id, image));

CREATE TABLE product_tag(product_id INT NOT NULL, tag VARCHAR(80) NOT NULL, PRIMARY KEY(product_id, tag));

CREATE TABLE cart_coupon(username VARCHAR(255) REFERENCES cart, coupon_code VARCHAR(80) REFERENCES coupon, PRIMARY KEY(username, coupon_code));

CREATE TABLE cart_product(username VARCHAR(255) REFERENCES cart, product_id INT, quantity INT NOT NULL, PRIMARY KEY(username, product_id));

CREATE TABLE order_coupon(order_number INT REFERENCES storeorder(order_number), coupon_code VARCHAR(80) REFERENCES coupon, PRIMARY KEY(order_number, coupon_code));

CREATE TABLE order_product(order_number INT REFERENCES storeorder(order_number), product_id INT, quantity INT NOT NULL, price NUMERIC(14, 2) NOT NULL, PRIMARY KEY(order_number, product_id));

CREATE TABLE publishes(product_id INT PRIMARY KEY, publisher_name VARCHAR(80) REFERENCES publisher(name), year_published SMALLINT, reorder_threshold INT, commission_percent NUMERIC(5, 3));

CREATE TABLE stored_in(product_id INT PRIMARY KEY, name VARCHAR(80) NOT NULL REFERENCES warehouse, stock INT NOT NULL, aisle INT);

CREATE TABLE writes(product_id INT NOT NULL REFERENCES book, name VARCHAR(80) NOT NULL REFERENCES author, PRIMARY KEY(product_id, name));

